"""
214. Shortest Palindrome
You are given a string s. You can convert s to a
palindrome
by adding characters in front of it.

Return the shortest palindrome you can find by performing this transformation.

Example 1:

Input: s = "aacecaaa"
Output: "aaacecaaa"

Example 2:

Input: s = "abcd"
Output: "dcbabcd"

Constraints:

    0 <= s.length <= 5 * 104
    s consists of lowercase English letters only.

Further tests:
""
"aabba"
""
"abb"
""
"aacecaa"
"aaaaaaaaaaaaaaaaaaaaaaaa"

"""
import unittest


class TesIsPalindrome(unittest.TestCase):
    def setUp(self):
        self.solution = Solution()

    def test_example_1(self):
        s = "aacecaaa"
        out = "aaacecaaa"
        self.assertEqual(out, self.solution.shortestPalindrome(s))

    def test_example_2(self):
        s = "abcd"
        out = "dcbabcd"
        self.assertEqual(out, self.solution.shortestPalindrome(s))

    def test_example_3(self):
        s = ""
        out = ""
        self.assertEqual(out, self.solution.shortestPalindrome(s))

    def test_example_4(self):
        s = "abb"
        out = "bbabb"
        self.assertEqual(out, self.solution.shortestPalindrome(s))


class Solution:
    def shortestPalindrome(self, s: str) -> str:

        if len(s) < 2:  # short string is a palindrome
            return s

        def kmp_prefix_function(s):
            n = len(s)
            pi = [0] * n

            for i in range(1, n):
                j = pi[i - 1]
                while j > 0 and s[i] != s[j]:
                    j = pi[j - 1]
                if s[i] == s[j]:
                    j += 1
                pi[i] = j

            return pi

        # Reverse the input string
        reversed_string = s[::-1]

        # Build the prefix table
        prefix_table = kmp_prefix_function(s + "#" + reversed_string)

        # The longest palindromic prefix is stored in the last item
        palindrome_length = prefix_table[-1]

        # Return the shortest palindrome
        return reversed_string[: len(s) - palindrome_length] + s
